import React from "react";
import "./RecipeExtraInfo.css";
import ExtraLink from "../extraLink/ExtraLink";
import CardInfo from "../../cardInfo/CardInfo";

export default function RecipeExtraInfo() {
  return (
    <div className="recipe-extra-info">
    <CardInfo header="Looking for recipes?" text="Discover more than 1000 fantastic recipes with Sousmate. You will love them!" />
        <CardInfo header="Recipes by Ingredient" text="Discover more than 1000 fantastic recipes with Sousmate. You will love them!" />
        <ExtraLink />
      <CardInfo header="Who we are?" text="Narrow your search by main ingredient to find recipes and meal ideas fast:" />
     
    </div>
  );
}
